// out: francine.css, compress: true
/* francine */
.vendor(@property, @value) {
    @{property}: @value;
    @{property}: @value;
}
@blue: #1485a3;
@dresscolor: @blue;
@lightblue: lighten(@dresscolor, 20%);
@wrapcolor: #a8c4d5;
@lighterblue: #9bcedc;
@lacecolor: lighten(@wrapcolor, 11%);

.pseudoclear {
    content: "";
    display: block;
    position: absolute;
    print-color-adjust: exact;
    filter: opacity(1);
}

div,
svg,
ul,
li {
    position: absolute;
    print-color-adjust: exact;
    filter:opacity(1);
    box-sizing: border-box;
}

html {
    min-width: 665px;
}

@xpos: `Math.random() * 600`;
@ypos: `Math.random() * 1000`;
@pixels: px;

body {
    font-size: 1px;
    background-color: #281b11;
    background-image: linear-gradient(to bottom, #2c3521, #0b0e07);
    padding: 33px 5px 66px;

    .linksection {
        font-size: 12px;
        text-align: center;
        position: static;
        padding: 0 0 67px;
        font-family: 'Century Gothic', Arial, sans-serif;
        color: #68705e;

        .separator {
            padding: 0 5px;
        }

        a {
            color: #788d6a;
        }
    }

    .paper {
        position: relative;
        margin: auto;
        background-color: #242c1a;
        background-image: radial-gradient(circle farthest-corner at 126% 36%, rgba(0,0,0,0) 65%, #000206 81%),radial-gradient(circle farthest-corner at 47% 50%, #5d818a 9%, #062931 76%);
        box-shadow: 0 0 10px 8px #251e0b, 0 0 5px 20px #473c1c, 0 0 14px 34px #2e2613, 0 0 0 40px #261e0f;
        overflow: hidden;
        box-sizing: content-box;
        width: 650px;

        .container {
            position: relative;
            margin: auto;
            width: 100%;
            height: 1050px;
            perspective: 400px;

            &:after {
                .pseudoclear;
                height: 100%;
                width: 100%;
                background: rgba(161, 119, 104, 0.18);
                pointer-events: none;
            }

            .tree {
                width: 100%;
                height: 100%;
                // .leaf001 {
                //     left: 56%;
                //     top: 2%;
                //     width: 7%;
                //     height: 4%;
                //     border-radius: 50%;
                //     background: #0d370a;
                //     color: #042a11;
                //     box-shadow: 0 0 15px 8px, inset 0 0 20px 9px;
                // }
            }

            .square {
                top: 8%;
                left: 0;
                right: 0;
                margin: auto;
                width: 100%;
                height: 72%;

                .flower {
                    width: 112%;
                    height: 168%;
                    bottom: 49%;
                    right: 42%;

                    .stem {
                        border-radius: 90%;

                        &.st1 {
                            border-right: 3px solid #578857;
                            width: 32%;
                            height: 90%;
                            transform: rotate(-66deg);
                        }

                        &.st2 {
                            border-left: 4px solid #578857;
                            width: 32%;
                            height: 70%;
                            top: 22%;
                            left: 27%;
                            transform: rotate(-76deg);
                        }
                    }

                    .flowerbody {
                        &.f1 {
                            width: 100%;
                            height: 50%;
                            transform: rotateX(39deg) skewY(-15deg);
                            top: -2%;
                            left: -139%;
                        }

                        &.f2 {
                            width: 72%;
                            height: 34%;
                            transform: rotateX(29deg) skewY(-1deg) rotateY(-57deg);
                            top: 36%;
                            left: -82%;
                        }

                        .bud {
                            background: #f7c465;
                            width: 15%;
                            height: 15%;
                            border-radius: 50%;
                            left: 53%;
                            top: 39%;
                            box-shadow: inset 0 -4px 6px 0 #d2711f;
                        }

                        .petal {
                            width: 24%;
                            height: 50%;
                            box-shadow: inset 0 -8px 10px 1px #ad4a68;
                            background: pink;
                            border-radius: ~ '50% 50% 50% 50% / 20% 20% 80% 80%';
                            transform-origin: 50% 100%;
                            left: 50%;
                            top: 0;

                            &:nth-of-type(2) {
                                transform: rotate(30deg);
                            }

                            &:nth-of-type(3) {
                                transform: rotate(60deg);
                            }

                            &:nth-of-type(4) {
                                transform: rotate(90deg);
                            }

                            &:nth-of-type(5) {
                                transform: rotate(120deg);
                            }

                            &:nth-of-type(6) {
                                transform: rotate(150deg);
                            }

                            &:nth-of-type(7) {
                                transform: rotate(180deg);
                            }

                            &:nth-of-type(8) {
                                transform: rotate(210deg);
                            }

                            &:nth-of-type(9) {
                                transform: rotate(240deg);
                            }

                            &:nth-of-type(10) {
                                transform: rotate(270deg);
                            }

                            &:nth-of-type(11) {
                                transform: rotate(300deg);
                            }

                            &:nth-of-type(12) {
                                transform: rotate(330deg);
                            }
                        }
                    }
                }

                .metal {
                    background-color: #c19e4d;
                    box-shadow: inset 4px 3px 2px -1px rgba(255, 245, 211, 0.32);
                    background-image: radial-gradient(ellipse at 45% -2%, #dbd1ac 5%, #8e8150 24%, #665f44 53%, #4b4532 62%);
                }

                .sash {
                    border-radius: ~'0 0 49% 51% / 0 0 54% 74%';
                    width: 142%;
                    height: 17%;
                    left: -13%;
                    top: -26%;
                    transform: rotate(3deg);

                    .rightsash {
                        border-radius: ~'0 90% 90% 0 / 0 50% 50% 0';
                        height: 57%;
                        width: 4%;
                        background: darken(@dresscolor, 22%);
                        right: -3%;
                        top: 4%;
                    }

                    .bottom {
                        border-radius: inherit;
                        width: 100%;
                        height: 85%;
                        box-shadow: inset 0 -5px 10px -8px darken(@dresscolor, 19%), inset 0 -16px 2px -1px darken(@dresscolor, 22%), 11px 6px 2px -4px darken(@dresscolor, 25%), 0 11px 5px -5px rgba(26,8,8,0.25);
                    }

                    .mid {
                        border-radius: ~'0 0 29% 50% / 0 0 26% 76%';
                        width: 86%;
                        height: 93%;
                        box-shadow: inset 0 -21px 1px -4px darken(@dresscolor, 3%), inset 0 -20px 2px -1px tint(@dresscolor, 25%);
                    }

                    .left {
                        border-radius: ~'50% 50% 0 0 / 100% 100% 0 0';
                        width: 11%;
                        height: 57%;
                        top: 3%;
                        left: -4%;
                        transform: rotate(-41deg);
                        box-shadow: inset 0 22px 2px -3px darken(@dresscolor, 18%);
                    }

                    .right {
                        border-radius: ~'50% 50% 0 0 / 100% 100% 0 0';
                        width: 11%;
                        height: 57%;
                        top: 6%;
                        right: -4%;
                        transform: rotate(41deg);
                        box-shadow: inset 0 22px 2px -3px darken(@dresscolor, 15%);
                    }

                    .triangle {
                        &.ta {
                            left: 30%;
                            bottom: 0;
                            border-bottom: 9px solid tint(@dresscolor, 3%);
                            border-left: 4px solid transparent;
                            border-right: 7px solid transparent;
                        }

                        &.tb {
                            left: -1%;
                            bottom: 0;
                            border-bottom: 3px solid tint(@dresscolor, 14%);
                            border-left: 7px solid transparent;
                            border-right: 14px solid transparent;
                        }

                        &.tc {
                            left: 43%;
                            bottom: 0;
                            border-bottom: 7px solid tint(@dresscolor, 8%);
                            border-left: 21px solid transparent;
                            border-right: 14px solid transparent;
                        }

                        &.t00 {
                            bottom: 59%;
                            left: -3%;
                            width: 10%;
                            height: 38%;
                            overflow: hidden;
                            border-radius: 25% 0 0 75%;
                            transform: skewX(-46deg) skewY(18deg);
                            background: linear-gradient(113deg, darken(@dresscolor, 23%), darken(@dresscolor, 6%) 66%);
                        }

                        &.t0 {
                            bottom: 39%;
                            left: 4%;
                            width: 9%;
                            height: 38%;
                            overflow: hidden;
                            transform: skewX(-46deg) skewY(12deg);
                            background: linear-gradient(163deg, tint(@dresscolor, 25%), darken(@dresscolor, 6%) 30%, darken(@dresscolor, 6%) 69%, darken(@dresscolor, 11%));
                        }

                        &.t1 {
                            bottom: 26%;
                            left: 11%;
                            width: 9%;
                            height: 38%;
                            transform: skewX(-46deg) skewY(12deg);
                            background: linear-gradient(to bottom, tint(@dresscolor, 19%), tint(@dresscolor, 2%), tint(@dresscolor, 25%));
                        }

                        &.t2 {
                            bottom: 19%;
                            left: 18%;
                            width: 9%;
                            height: 40%;
                            transform: skewX(-46deg) skewY(6deg);
                            background: linear-gradient(165deg, tint(@dresscolor, 19%), tint(@dresscolor, 9%), tint(@dresscolor, 25%) 66%);
                            box-shadow: inset -7px 0 5px -3px tint(@dresscolor, 5%);
                        }

                        &.t3 {
                            left: 33%;
                            bottom: 21%;
                            border-top: 14px solid @dresscolor;
                            border-left: 7px solid transparent;
                        }

                        &.t4 {
                            left: 28%;
                            bottom: 10%;
                            height: 43%;
                            width: 23%;
                            transform: skewX(-41deg) skewY(3deg);
                            background: linear-gradient(74deg, darken(@dresscolor, 5%) 35%, darken(@dresscolor, 10%) 43%, darken(@dresscolor, 5%) 53%);
                        }

                        &.t5 {
                            left: 19%;
                            bottom: 25%;
                            border-top: 17px solid tint(@dresscolor, 2%);
                            border-left: 2px solid transparent;
                            border-right: 2px solid transparent;
                            transform: rotate(34deg);
                        }

                        &.t6 {
                            left: 35.5%;
                            bottom: 21%;
                            border-top: 14px solid tint(@dresscolor, 6%);
                            border-right: 7px solid transparent;
                        }

                        &.t7 {
                            left: 47%;
                            bottom: 12%;
                            height: 40%;
                            width: 15%;
                            transform: skewX(-41deg) skewY(-1deg);
                            background: linear-gradient(74deg, darken(@dresscolor, 16%) 35%, tint(@dresscolor, 1%) 75%);
                        }

                        &.t8 {
                            left: 61%;
                            bottom: 11%;
                            height: 45%;
                            width: 23%;
                            transform: skewX(-41deg) skewY(-3deg);
                            background: linear-gradient(39deg, darken(@dresscolor, 4%) 25%, tint(@dresscolor, 15%) 44%, darken(@dresscolor, 5%) 50%, darken(@dresscolor, 5%) 52%, darken(@dresscolor, 20%));
                        }
                    }

                    .shad {
                        &.s1 {
                            border-radius: ~'0 0 50% 50% / 0 0 99% 99%';
                            left: 9%;
                            bottom: 15%;
                            width: 35%;
                            height: 32%;
                            transform: rotate(9deg);
                            box-shadow: 0 0 6px 3px rgba(42, 19, 19, 0.66);
                        }

                        &.s2 {
                            border-radius: ~'25% 75% 0 0 / 99% 99% 0 0';
                            left: 7%;
                            top: 37%;
                            width: 29%;
                            height: 19%;
                            box-shadow: 0 0 6px 3px rgba(42, 19, 19, 0.66);
                        }

                        &.s3 {
                            right: 2%;
                            top: 42%;
                            width: 18%;
                            transform: rotate(-20deg);
                            box-shadow: 0 0 4px 6px rgba(42, 19, 19, 0.33);
                        }

                        &.s4 {
                            border-radius: ~'0 0 25% 75% / 0 0 99% 99%';
                            left: 49%;
                            top: 71%;
                            width: 29%;
                            height: 19%;
                            box-shadow: 0 0 3px 5px rgba(42,19,19,0.33);
                        }
                    }
                }

                .pearlstring {
                    border-radius: ~ '0 0 50% 50% / 0 0 100% 100%';
                    border-color: #a9864b;
                    // border-style: solid;
                    border-width: 0 1px 1px 1px;

                    &.left {
                        border-style: solid;
                        top: -18%;
                        left: -12%;
                        width: 66%;
                        transform: rotate(8deg);

                        &.short {
                            height: 10%;
                        }

                        &.long {
                            height: 23%;
                        }

                        .pearl0 {
                            background-color: darken(@wrapcolor, 15%);
                        }

                        .pearl1 {
                            background-color: darken(@wrapcolor, 12%);
                        }

                        .pearl2 {
                            background-color: darken(@wrapcolor, 9%);
                        }

                        .pearl3 {
                            background-color: darken(@wrapcolor, 6%);
                        }

                        .pearl4 {
                            background-color: darken(@wrapcolor, 3%);
                        }
                    }

                    &.mid {
                        height: 20%;
                        width: 28%;
                        left: 35%;
                        top: 3%;
                        transform: rotate(-30deg);

                        .pearl {
                            width: 10px;
                            height: 8px;
                        }
                    }

                    &.right {
                        width: 60%;
                        left: 114%;
                        top: -24%;
                        transform: rotate(-31deg);

                        .pearl {
                            background-color: darken(@wrapcolor, 30%);
                        }

                        &.short {
                            height: 10%;

                            .pearl8 {
                                background: darken(@wrapcolor, 45%);
                                box-shadow: none;
                            }

                            .pearl7 {
                                background-color: darken(@wrapcolor, 35%);
                                box-shadow: none;
                            }
                        }

                        &.long {
                            height: 21%;

                            .pearl11 {
                                box-shadow: none;
                                background: darken(@wrapcolor, 55%);
                            }

                            .pearl10 {
                                background-color: darken(@wrapcolor, 45%);
                            }
                        }
                    }

                    .pearl {
                        width: 6px;
                        margin-left: -4px;
                        height: 6px;
                        bottom: 0;
                        border-radius: 50%;
                        background-color: @wrapcolor;
                        background-image: radial-gradient(ellipse at 30% 30%, rgba(255, 255, 255, 0.67) 12%, transparent 15%, transparent 51%, rgba(0, 0, 0, 0.45) 70%);
                        box-shadow: 2px 4px 3px -1px rgba(0, 0, 0, 0.45);

                        &.pearl0 {
                            top: 0;
                            left: 0;
                        }

                        &.pearl1 {
                            top: 13%;
                            left: 1%;
                        }

                        &.pearl2 {
                            top: 25%;
                            left: 3%;
                        }

                        &.pearl3 {
                            top: 38%;
                            left: 6%;
                        }

                        &.pearl4 {
                            top: 50%;
                            left: 10%;
                        }

                        &.pearl5 {
                            top: 61%;
                            left: 14%;
                        }

                        &.pearl6 {
                            top: 71%;
                            left: 19%;
                        }

                        &.pearl7 {
                            top: 77%;
                            left: 24%;
                        }

                        &.pearl8 {
                            top: 84%;
                            left: 29%;
                        }

                        &.pearl9 {
                            top: 89%;
                            left: 34%;
                        }

                        &.pearl10 {
                            top: 91%;
                            left: 39%;
                        }

                        &.pearl11 {
                            top: 95%;
                            left: 44%;
                        }

                        &.pearl12 {
                            top: 95%;
                            left: 50%;
                        }

                        &.pearl13 {
                            top: 92%;
                            left: 56%;
                        }

                        &.pearl14 {
                            top: 89%;
                            left: 62%;
                        }

                        &.pearl15 {
                            top: 86%;
                            left: 67%;
                        }

                        &.pearl16 {
                            top: 80%;
                            left: 73%;
                        }

                        &.pearl17 {
                            top: 73%;
                            left: 78%;
                        }

                        &.pearl18 {
                            top: 66%;
                            left: 83%;
                        }

                        &.pearl19 {
                            top: 55%;
                            left: 88%;
                        }

                        &.pearl20 {
                            top: 44%;
                            left: 93%;
                        }

                        &.pearl21 {
                            top: 31%;
                            left: 97%;
                        }

                        &.pearl22 {
                            top: 19%;
                            left: 99%;
                        }

                        &.pearl23 {
                            top: 7%;
                            left: 100%;
                        }
                    }
                }

                .hairdo {
                    top: 23.5%;
                    left: 26%;
                    width: 28%;
                    height: 30%;
                    transform: rotate(-9deg);
                }

                .body,
                .hairdo {
                    .band {
                        border-radius: ~ '92% 8% 9% 9% / 59% 90% 11% 15%';
                        z-index: 2;
                        height: 10%;
                        box-shadow: inset -3px 1px 0 0 rgba(23, 105, 114, 0.28), inset -3px 2px 0 0 rgba(255, 255, 255, 0.2), inset -7px -3px 0 -1px rgba(11, 40, 50, 0.14), 7px 1px 5px 1px rgba(87, 63, 37, 0.51);

                        &.left {
                            width: 132%;
                            left: -12%;
                            top: -22%;
                            background: linear-gradient(to left, #40656e 6%, #619a9c, #82b5b7 95%, #437a8a 99%);
                            transform: rotate(11deg);
                        }

                        &.right {
                            width: 27%;
                            right: -35%;
                            top: -15%;
                            background: linear-gradient(to left, #204954, #3f6977 64%, #1b2f32);
                            transform: rotate(-30deg) scaleX(-1);
                        }
                    }

                    .medallion {
                        width: 19%;
                        height: 31%;
                        top: -26%;
                        z-index: 9;

                        &:before {
                            .pseudoclear;
                            height: 80%;
                            left: 72%;
                            top: 15%;
                            box-shadow: 0 0 6px 5px rgba(57, 31, 12, 0.55);
                        }

                        .metal {
                            border-radius: ~ '35% 35% 50% 50% / 5% 5% 95% 95%';

                            &.middle {
                                right: 0;
                                left: 0;
                                top: 0;
                                margin: auto;
                                width: 69%;
                                height: 39%;
                            }

                            &.back {
                                left: 0;
                                top: 5%;
                                width: 100%;
                                height: 35%;
                            }

                            &.arrow {
                                left: 0;
                                right: 0;
                                margin: auto;
                                height: 13%;

                                &.one {
                                    bottom: 36%;
                                    width: 43%;
                                }

                                &.two {
                                    bottom: 27%;
                                    width: 36%;
                                    left: 5%;
                                }

                                &.three {
                                    bottom: 18%;
                                    width: 33%;
                                    left: 8%;
                                }

                                &.four {
                                    bottom: 9%;
                                    width: 30%;
                                    left: 16%;
                                }

                                &.five {
                                    bottom: 0;
                                    width: 24%;
                                    left: 23%;
                                }
                            }
                        }

                        &.left {
                            left: 45%;
                            transform: rotate(3deg) skewX(1deg) skewY(1deg);
                        }

                        &.right {
                            right: -15%;
                            transform: rotate(-6deg) skewX(4deg) skewY(13deg);

                            .metal {
                                background-color: #9c842d;

                                &.right {
                                    right: 11%;
                                }
                            }
                        }

                        .pearlback {
                            width: 60%;
                            height: 29%;
                            left: 0;
                            right: 0;
                            margin: auto;
                            bottom: 45%;
                            border-radius: 50%;
                        }

                        .pearl {
                            width: 63%;
                            height: 67%;
                            top: 0;
                            bottom: 0;
                            background: #8bd3d4;
                            box-shadow: inset 0 -5px 3px -1px #34727b, inset 0 -4px 7px 4px #4f7e88, 0 -1px 7px 3px #9c8546;
                            border-radius: 50%;
                            left: 0;
                            right: 0;
                            margin: auto;
                        }
                    }

                    .side {
                        bottom: -30%;
                        overflow: hidden;
                        width: 94%;
                        height: 150%;

                        &.left {
                            right: 50%;
                        }

                        &.right {
                            left: 50%;
                        }
                    }

                    .feather {
                        &.feather1 {
                            width: 54%;
                            height: 23%;
                            top: -44%;
                            right: -47%;
                            transform: rotate(113deg);

                            .featherside .feath {
                                border-right-width: 5px;
                            }
                        }

                        &.feather2 {
                            width: 74%;
                            height: 35%;
                            top: -61%;
                            right: -33%;
                            transform: rotate(45deg);
                        }

                        &:after {
                            .pseudoclear;
                            top: 32%;
                            margin-top: -1px;
                            height: 30%;
                            box-shadow: inset -6px -8px 1px -6px #af7373, -5px 20px 31px -10px rgba(136,17,50,0.62);
                            border-radius: 90%;
                            width: 100%;
                        }

                        .featherside {
                            border-radius: ~ '0% 56% 0% 0 / 0% 100% 0% 0';
                            height: 51%;
                            width: 100%;

                            &.left {
                                bottom: 0;
                                transform: scaleY(-1);
                            }

                            &.right {
                                top: 0;

                                .feath {
                                    &:nth-of-type(5n+3) {
                                        transform: rotate(6deg);
                                    }

                                    &:nth-of-type(2n+7) {
                                        transform: rotate(-2deg);
                                    }
                                }
                            }

                            .feath {
                                background: none;
                                border-right-style: double;
                                border-right-width: 7px;
                                border-color: #ab636f;
                                transform-origin: 100% 100%;
                                max-width: 74%;
                                bottom: 0;
                                height: 106%;
                                box-shadow: none;
                                height: 100%;
                                border-radius: inherit;
                                opacity: 0.6;

                                &:nth-of-type(odd) {
                                    border-color: #9a4c6b;
                                }

                                &.feath1 {
                                    right: 0;
                                    width: 53%;
                                }

                                &.feath2 {
                                    right: 2%;
                                    width: 85%;
                                }

                                &.feath3 {
                                    right: 4%;
                                    width: 53%;
                                }

                                &.feath4 {
                                    right: 6%;
                                    width: 86%;
                                }

                                &.feath5 {
                                    right: 8%;
                                    width: 58%;
                                }

                                &.feath6 {
                                    right: 10%;
                                    width: 63%;
                                }

                                &.feath7 {
                                    right: 12%;
                                    width: 56%;
                                }

                                &.feath8 {
                                    right: 14%;
                                    width: 84%;
                                }

                                &.feath9 {
                                    right: 16%;
                                    width: 56%;
                                }

                                &.feath10 {
                                    right: 18%;
                                    width: 68%;
                                }

                                &.feath11 {
                                    right: 20%;
                                    width: 53%;
                                }

                                &.feath12 {
                                    right: 22%;
                                    width: 83%;
                                }

                                &.feath13 {
                                    right: 24%;
                                    width: 54%;
                                }

                                &.feath14 {
                                    right: 26%;
                                    width: 66%;
                                }

                                &.feath15 {
                                    right: 28%;
                                    width: 58%;
                                }

                                &.feath16 {
                                    right: 30%;
                                    width: 120%;
                                }

                                &.feath17 {
                                    right: 32%;
                                    width: 52%;
                                }

                                &.feath18 {
                                    right: 34%;
                                    width: 64%;
                                }

                                &.feath19 {
                                    right: 36%;
                                    width: 56%;
                                }

                                &.feath20 {
                                    r: ight 37%;
                                    width: 88%;
                                }

                                &.feath21 {
                                    right: 40%;
                                    width: 58%;
                                }

                                &.feath22 {
                                    right: 42%;
                                    width: 52%;
                                }

